import React from 'react';
import Header from '../../Parts/Header/header.js';
import Footer from '../../Parts/Footer/footer.js';
import Content from './content.js';
import './about-us.js'

  class About extends React.Component{
    render() {
      return (
        <div>
          <Header />
          <Content />
          <Footer />
        </div>

      );
    }
  }
  export default About;
